import React, { useState } from 'react';
import { dbService } from '../fbase';

function Internship() {
    let [infoNum, setInfoNum] = useState(0)
    const onSubmit = (event) => {
        event.preventDefault();
        dbService.collection("UKOV").update({
            test: "test3",
            test2: "test2"
        })
    }
    return (
        <div>홈탭의 UKOV후기와 프로그램탭의 스타트업 인턴십 같이 수정되는 곳입니다!</div>
    )
}

export default Internship;
